            "          <div class=\"body\" id=\"anchor817666\">\n",
            "           <h2 class=\"text_header\">\n",
            "            \"Extremely sub-par service\"\n",
            "           </h2>\n",
            "           <h3 class=\"text_sub_header userStatusWrapper\">\n",
            "            <span itemprop=\"author\" itemscope=\"\" itemtype=\"http://schema.org/Person\">\n",
            "             <span itemprop=\"name\">\n",
            "              S SI\n",
            "             </span>\n",
            "            </span>\n",
            "            (United States)\n",
            "            <time datetime=\"2022-11-28\" itemprop=\"datePublished\">\n",
            "             28th November 2022\n",
            "            </time>\n",
            "           </h3>\n",
            "           <div class=\"tc_mobile\">\n",
            "            <div class=\"text_content \" itemprop=\"reviewBody\">\n",
            "             \n",
            "             <strong>\n",
            "              <a href=\"https://www.airlinequality.com/verified-reviews/\">\n",
            "               <em>\n",
            "                Trip Verified\n",
            "               </em>\n",
            "              </a>\n",
            "             </strong>\n",
            "             | Extremely sub-par service. Highlights: No online meal selection. Staff pretty much dropped off whatever meal they had and were very rude if a passenger wanted it changed. Last meal was delayed to the last 40 minutes of flight. Plates were literally grabbed away. I had to hand over my unfinished plate that the staff again dropped on me. No apology. No offer of a napkin. I had to scrounge for a piece of paper to clean my jacket. None of the passengers were told to straighten up their seats before meal. Because the seat before me was so tilted, I could barely keep the plate on the tray without things slipping off. Staff walked down with some water and biscuits. This got exhausted just before she got to me. She just looked at me and walked away. Nothing further was offered.\n",
