            "           <h2 class=\"text_header\">\n",
            "            \"baggage yet to be delivered after 5 weeks\"\n",
            "           </h2>\n",
            "           <h3 class=\"text_sub_header userStatusWrapper\">\n",
            "            <span itemprop=\"author\" itemscope=\"\" itemtype=\"http://schema.org/Person\">\n",
            "             <span itemprop=\"name\">\n",
            "              Iviano Ossuetta\n",
            "             </span>\n",
            "            </span>\n",
            "            (United Arab Emirates)\n",
            "            <time datetime=\"2022-11-05\" itemprop=\"datePublished\">\n",
            "             5th November 2022\n",
