            "          <div class=\"body\" id=\"anchor812064\">\n",
            "           <h2 class=\"text_header\">\n",
            "            \"zero faith in British Airways\"\n",
            "           </h2>\n",
            "           <h3 class=\"text_sub_header userStatusWrapper\">\n",
            "            <span itemprop=\"author\" itemscope=\"\" itemtype=\"http://schema.org/Person\">\n",
            "             <span itemprop=\"name\">\n",
            "              R Zhang\n",
            "             </span>\n",
            "            </span>\n",
            "            (United States)\n",
            "            <time datetime=\"2022-10-31\" itemprop=\"datePublished\">\n",
            "             31st October 2022\n",
