            "          <div class=\"body\" id=\"anchor811851\">\n",
            "           <h2 class=\"text_header\">\n",
            "            \"about as abysmal as you can get\"\n",
            "           </h2>\n",
            "           <h3 class=\"text_sub_header userStatusWrapper\">\n",
            "            <span itemprop=\"author\" itemscope=\"\" itemtype=\"http://schema.org/Person\">\n",
            "             <span itemprop=\"name\">\n",
            "              Amanda Edgar\n",
            "             </span>\n",
            "            </span>\n",
            "            (United Kingdom)\n",
            "            <time datetime=\"2022-10-30\" itemprop=\"datePublished\">\n",
            "             30th October 2022\n",
            "            </time>\n",
            "           </h3>\n",
            "           <div class=\"tc_mobile\">\n",
            "            <div class=\"text_content \" itemprop=\"reviewBody\">\n",
            "             <strong>\n",
            "              <a href=\"https://www.airlinequality.com/verified-reviews/\">\n",
            "               <em>\n",
            "                Not Verified\n",
            "               </em>\n",
            "              </a>\n",
            "             </strong>\n",
            "             |  Ive generally been a loyal Gold status flyer with BA if they fly the route Im after but my recent flight to Nairobi was about as abysmal as you can get. We should have departed at 10:20 but after continuous delays finally left 4.5 hours late, not ideal when youve then got an 8hr + flight. Staff informed us virtually as we took off that the meal and drinks service would be started and completed asap as they needed to get rest because of hours we had been delayed. They couldnt get it out and away quickly enough. That was then basically the last you saw of them until they came around an hour or so before landing. I sincerely hope they enjoyed their rest because when you pay full fare for business class service you actually expect a service. They were all extremely miserable and clearly didnt want to be on board. Were still waiting for you to pay our compensation that has been awarded to us by the official ombudsman in July for the cancellation of our flight to Miami in March. This was cancelled at 3am for the 2:30 pm flight !\n",
            "            </div>\n",
