            "          </div>\n",
            "          <div class=\"body\" id=\"anchor811094\">\n",
            "           <h2 class=\"text_header\">\n",
            "            \"no attempt to provide fresh or hot foo\"\n",
            "           </h2>\n",
            "           <h3 class=\"text_sub_header userStatusWrapper\">\n",
            "            <span itemprop=\"author\" itemscope=\"\" itemtype=\"http://schema.org/Person\">\n",
            "             <span itemprop=\"name\">\n",
            "              P Marten\n",
            "             </span>\n",
            "            </span>\n",
            "            (United Kingdom)\n",
            "            <time datetime=\"2022-10-25\" itemprop=\"datePublished\">\n",
            "             25th October 2022\n",
            "            </time>\n",
            "           </h3>\n",
            "           <div class=\"tc_mobile\">\n",
            "            <div class=\"text_content \" itemprop=\"reviewBody\">\n",
            "             \n",
            "             <strong>\n",
            "              <a href=\"https://www.airlinequality.com/verified-reviews/\">\n",
            "               <em>\n",
            "                Trip Verified\n",
            "               </em>\n",
            "              </a>\n",
            "             </strong>\n",
            "             |  Just a few years ago flying on BA was enjoyable, but times have changed. These days about five hours on board the plane is no fun at all. The Terminal 5 experience still feels classy, and on the way out it felt well staffed and efficient. On board though, its just become an experience to be endured. BAs mean decision to split seats into nicer for the first half of the plane, and nastier for the rest underlines this. There is no entertainment, no magazine. Refreshment purchases are brought to the seat after ordering from an app. There is no attempt to provide fresh or hot food on the day, despite the competition being able to do this. Is it too much to ask for, when trapped on board for five hours? You get a free tiny bottle of water and a small cereal bar. On the outbound flight the crew collected rubbish just once before landing, but helpfully tied a bag around a toilet door down the back in case anyone wanted to fight their way past and clear things up themselves. Recline buttons have been deleted on the seats and the seat pitch feels squeezed. On the return flight, for one reason or another due to BAs delays from the previous day, we were just under two hours late getting off the plane late in the evening and some passengers couldnt travel at all because there were not enough crew. The cabin crew were nonetheless distinctly more professional on this flight. Altogether, I would say good things if there were any - but its hard to think of anything I could recommend BA for; and that is a pity, because it used to be a professional company to deal with and a pleasure worth looking forward to when making European journeys.\n",
            "            </div>\n",
