            "         <article class=\"comp comp_media-review-rated list-item media position-content review-810461\" itemprop=\"review\" itemscope=\"\" itemtype=\"http://schema.org/Review\">\n",
            "          <meta content=\"2022-10-22\" itemprop=\"datePublished\"/>\n",
            "          <div class=\"rating-10\" itemprop=\"reviewRating\" itemscope=\"\" itemtype=\"http://schema.org/Rating\">\n",
            "           <span itemprop=\"ratingValue\">\n",
            "            1\n",
