            "           <div class=\"tc_mobile\">\n",
            "            <div class=\"text_content \" itemprop=\"reviewBody\">\n",
            "             <strong>\n",
            "              <a href=\"https://www.airlinequality.com/verified-reviews/\">\n",
            "               <em>\n",
            "                Not Verified\n",
            "               </em>\n",
            "              </a>\n",
            "             </strong>\n",
            "             |  LHR-LAX. I prefer the Boeing 777 over the A380 as the seats don't seem too cramped. Check-in was very easy with the kiosks as was bag drop and security at Heathrow. T5 is a whole other story. Once through security its up the escalator, up the stairs, up the elevator, down the escalator get to the gate, no seating, then down an escalator and finally down the jet bridge to the plane. I have been in and out of Heathrow many times but never in T5 before. Anyway cabin crew were pleasant; drinks and meal service were fine. It was a day flight so no real sleeping and passengers were all moving around most of the flight. The entertainment system was good with decent options, so I occupied my time with several movies. Nice landing at LAX. All in all BA was just fine.\n",
