            "          <div class=\"body\" id=\"anchor805160\">\n",
            "           <h2 class=\"text_header\">\n",
            "            \"I will never travel BA again\"\n",
            "           </h2>\n",
            "           <h3 class=\"text_sub_header userStatusWrapper\">\n",
            "            <span itemprop=\"author\" itemscope=\"\" itemtype=\"http://schema.org/Person\">\n",
            "             <span itemprop=\"name\">\n",
            "              Ida Johansson\n",
            "             </span>\n",
            "            </span>\n",
            "            (Singapore)\n",
            "            <time datetime=\"2022-09-24\" itemprop=\"datePublished\">\n",
            "             24th September 2022\n",
            "            </time>\n",
            "           </h3>\n",
            "           <div class=\"tc_mobile\">\n",
            "            <div class=\"text_content \" itemprop=\"reviewBody\">\n",
            "             \n",
            "             <strong>\n",
            "              <a href=\"https://www.airlinequality.com/verified-reviews/\">\n",
            "               <em>\n",
            "                Trip Verified\n",
            "               </em>\n",
            "              </a>\n",
            "             </strong>\n",
            "             |  My 7am flight for a conference in June was cancelled with less than 12h notice - without being given any alternative flight or rebook me upon alternative flight. Upon calling customer service, customer service who said she can only get me a flight 2 days later. They did not work with me as I miss 2 days of conference. They asked me to travel to a different airport in Sweden (Stockholm); which I reluctantly agreed to as I was not given any other choice - but I had to pay for that domestic flight myself. Upon reaching the Gothenburg airport on the day of departure, I saw a direct flight to Heathrow, called customer service and was told there is 1 seat available. So I changed to 8.15am from Gothenburg - Heathrow - Jersey. However, at this point BA told me I have to pay a fee of GBP 710 as I changed my flight a 2nd time.  I find it a disgrace that BA charge a fee to change a flight that they cancelled, and they were unable to give alternative options to reach my destination in for the conference. BA proposed that I travel to another airport in Sweden at my own expense. I have since contacted BA for the legal compensation Im entitled to according to UK law, but I got a rejection as they claim I arranged my own travel to my destination. If I have a choice, I will never travel BA again. Such awful customer service and complete lack of understanding of customer needs.\n",
