            "           <p>\n",
            "            <strong>\n",
            "             British Airways\n",
            "            </strong>\n",
            "            is the flag carrier of the United Kingdom, with its main hub being at London Heathrow Airport where it operates from Terminal 5 and Terminal 3. The airline also has substantial operations from Gatwick Airport. British Airways is a member of Onweworld alliance, and part of International Airlines Group (IAG).\n",
