            "\n",
            "Not Verified |  This review is for BA booking system not a flight . Today I clicked wrong date on line, my mistake and expect to pay a fee. I then go to cancel booking and click on the option to not receive a voucher, immediately I received a response saying my voucher is on its way. I call them and speak to a gentleman who continuously spoke over me and would not listen to my concerns and eventually I give up and want to book a new flight, obviously at a much higher price but using the voucher I didnt want. However to my surprise I am unable to use this voucher because they cant tell me what it is until I receive it at a point in the future that they cant say when. So they now have my money and I have to re-book at full cost. In the end in order to get me off the phone they hung up.\n",
